import{_ as e}from"./chunks/sensor_airspeed.B2G_JAh5.js";import{_ as a,c as r,o as t,ab as o}from"./chunks/framework.CUflZczI.js";const u=JSON.parse('{"title":"Калібрування швидкості повітря","description":"","frontmatter":{},"headers":[],"relativePath":"uk/config/airspeed.md","filePath":"uk/config/airspeed.md"}'),i={name:"uk/config/airspeed.md"},l=o('<h1 id="калібрування-швидкості-повітря" tabindex="-1">Калібрування швидкості повітря <a class="header-anchor" href="#калібрування-швидкості-повітря" aria-label="Permalink to &quot;Калібрування швидкості повітря&quot;">​</a></h1><div class="info custom-block"><p class="custom-block-title"><a href="./../sensor/airspeed.html">Сенсори швидкості в повітрі</a> дуже рекомендовані для безпілотників із фіксованим крилом та вертикального зльоту.</p></div><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>У відміну від більшості інших драйверів датчиків, драйвери датчика швидкості повітря не запускаються автоматично. Перед калібруванням їх слід <a href="./../advanced_config/parameters.html">увімкнути за відповідним параметром</a>:</p><ul><li>Sensirion SDP3X (<a href="./../advanced_config/parameter_reference.html#SENS_EN_SDP3X">SENS_EN_SDP3X</a>)</li><li>TE MS4525 (<a href="./../advanced_config/parameter_reference.html#SENS_EN_MS4525DO">SENS_EN_MS4525DO</a>)</li><li>TE MS5525 (<a href="./../advanced_config/parameter_reference.html#SENS_EN_MS5525DS">SENS_EN_MS5525DS</a>)</li><li>Датчик швидкості в повітрі Eagle Tree (<a href="./../advanced_config/parameter_reference.html#SENS_EN_ETSASPD">SENS_EN_ETSASPD</a>)</li></ul></div><h2 id="виконання-калібрування" tabindex="-1">Виконання калібрування <a class="header-anchor" href="#виконання-калібрування" aria-label="Permalink to &quot;Виконання калібрування&quot;">​</a></h2><p>Для калібрування датчика швидкості повітря:</p><ol><li><p>Запустіть <em>QGroundControl</em> та підключіть транспортний засіб.</p></li><li><p>Увімкніть датчики швидкості повітря, якщо цього ще не було зроблено (як у попередженні вище).</p></li><li><p>Виберіть <strong>іконку &quot;Q&quot; &gt; Налаштування транспортного засобу &gt; Датчики</strong> (бічна панель), щоб відкрити <em>Налаштування датчиків</em>.</p></li><li><p>Натисніть кнопку датчика <strong>Airspeed</strong>.</p><p><img src="'+e+'" alt="Калібрування швидкості повітря"></p></li><li><p>Захистіть сенсор від вітру (тобто закрийте його рукою). Пильнуйте, щоб не заблокувати жодного з отворів.</p></li><li><p>Клацніть <strong>OK</strong>, щоб розпочати калібрування.</p></li><li><p>Після запиту, дмухніть у кінець труби пітота, щоб сигналізувати про завершення калібрування.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p></div></li></ol><p>Подування в трубку - це також базова перевірка того, що динамічні та статичні порти встановлені правильно. Якщо вони будуть поміняні місцями, то датчик буде відображати великий від&#39;ємний перепад тиску, коли ви дмухаєте в трубку, і калібрування завершиться з помилкою. :::</p><ol><li><em>QGroundControl</em> потім повідомляє вам, чи була калібрування успішною чи ні.</li></ol><h2 id="додаткова-інформація" tabindex="-1">Додаткова інформація <a class="header-anchor" href="#додаткова-інформація" aria-label="Permalink to &quot;Додаткова інформація&quot;">​</a></h2><ul><li><a href="https://docs.qgroundcontrol.com/master/en/qgc-user-guide/setup_view/sensors_px4.html#airspeed" target="_blank" rel="noreferrer"> QGroundControl Посібник користувача &gt; Датчики</a></li></ul>',10),s=[l];function n(c,_,p,d,m,S){return t(),r("div",null,s)}const g=a(i,[["render",n]]);export{u as __pageData,g as default};
